import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';

function AdminPage() {
    const navigate = useNavigate();
    const [submissions, setSubmissions] = useState([]); // Step 2: Initialize state

    useEffect(() => { // Step 3: Use useEffect to fetch data on component mount
        const fetchData = async () => {
            try {
                const response = await axios.get('http://yourserver.com/submissions'); // Replace with your actual endpoint
                setSubmissions(response.data); // Step 5: Update state with fetched data
            } catch (error) {
                console.error('Error fetching submissions:', error);
            }
        };
        fetchData();
    }, []); // Empty dependency array means this effect runs once on mount

    return (
        <div>
            <h1>Admin Page</h1>
            <div style={{ display: 'flex', flexDirection: 'column', alignItems: 'center', marginTop: '50px' }}>
                <button style={{
                    alignSelf: 'flex-end',
                    padding: '10px 20px',
                    fontSize: '16px',
                    backgroundColor: '#007BFF',
                    color: 'white',
                    border: 'none',
                    cursor: 'pointer',
                    marginBottom: '20px'
                }} onClick={() => navigate('/')}>Go Back to Ticket Entry</button>
                {/* Display fetched data */}
                <ul>
                    {submissions.map((submission, index) => (
                        <li key={index}>
                            <strong>Name:</strong> {submission.name}, <strong>Email:</strong> {submission.email}, <strong>Description:</strong> {submission.description}
                        </li>
                    ))}
                </ul>
            </div>
        </div>
    );
}

export default AdminPage;
